  "entities" : {
    "user_mentions" : [ ],
    "media" : [ ],
    "hashtags" : [ ],
    "urls" : [ ]
  },
  "geo" : { },
  "id_str" : "342036952624795648",
  "text" : "\"Not much, looking up gem types to continue jewel crafting research, and debating some impossibilities that have come up with another thing\"",
  "id" : 342036952624795648,
  "created_at" : "2013-06-04 21:55:38 +0000",
